window.bookSummaryJSON = "<p>The Best Year Ever! </p> <p>That's what Ramona thought the fourth grade was going to be, but things aren't turning out as she hoped. Sure, she has a new best friend named Daisy. But how can she improve her spelling as her teacher insists, or be the role model for her baby sister, Roberta, that Mrs. Quimby expects? Fourth-grade life is full of adventure and challenges, and at the end of it all - a \"zeroteenth\" birthday to celebrate!</p>"; 
